contracts/KhaosNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract KhaosNFT is ERC721, ERC721URIStorage, ERC721Burnable, Ownable {
  using Counters for Counters.Counter;

    /** STATE VARIABLES */
    Counters.Counter private _tokenIdCounter;
    uint256 private royaltyFee;
    address private royaltyRecipient;

    constructor(
        string memory _name,
        string memory _symbol,
        address _owner,
        uint256 _royaltyFee,
        address _royaltyRecipient
    ) ERC721(_name, _symbol) {
        require(_royaltyFee <= 10000, "Royalty can't be more than 10 percent");
        require(_royaltyRecipient != address(0));

        royaltyFee = _royaltyFee;
        royaltyRecipient = _royaltyRecipient;
        transferOwnership(_owner);
    }

    function safeMint(address to, string memory uri) payable public onlyOwner {
        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();
        _safeMint(to, tokenId);
        _setTokenURI(tokenId, uri);
    }

    /** OVERRIDES REQUIRED BY SOLIDITY */

    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId) public view override(ERC721, ERC721URIStorage) 
    returns (string memory){
        return super.tokenURI(tokenId);
    }

    function getRoyaltyFee() external view returns (uint256) {
        return royaltyFee;
    }

    function getRoyaltyRecipient() external view returns (address) {
        return royaltyRecipient;
    }

    function updateRoyaltyFee(uint256 _royaltyFee) external onlyOwner {
        require(_royaltyFee <= 10000, "Royalty can't be more than 10 percent");
        royaltyFee = _royaltyFee;
    }
}

contracts/KhaosNFTFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "./KhaosNFT.sol";

/* 
    Create new KhaosNFT collection
*/
contract KhaosNFTFactory {

    mapping(address => address[]) private nfts;
    mapping(address => bool) private khaosNFT;

    event CreatedNFTCollection(address creator, address nft, string name, string symbol);

    function createNFTCollection(
        string memory _name,
        string memory _symbol,
        uint256 _royaltyFee,
        address _royaltyRecipient
    ) external {
        KhaosNFT nft = new KhaosNFT(
            _name,
            _symbol,
            msg.sender,
            _royaltyFee,
            _royaltyRecipient
        );
        nfts[msg.sender].push(address(nft));
        khaosNFT[address(nft)] = true;
        emit CreatedNFTCollection(msg.sender, address(nft), _name, _symbol);
    }

    function getOwnCollections(address _owner) external view returns (address[] memory) {
        return nfts[_owner];
    }

    function isKhaosNFT(address _nft) external view returns (bool) {
        return khaosNFT[_nft];
    }
}

